column5:
Clarification

The challenge for this problem is jarring compared to the `Functions` problem which came before it. It wasn't obvious to me that the equation could be in the return statement, so my code ended up being overly verbose because I had to just guess a solution:

```
function math (firstArg, secondArg, thirdArg) {
        var argValue = secondArg * thirdArg + firstArg;
        return argValue;
}
console.log(math (53, 61, 67));
```
